import React, { useState } from "react";
import "bootstrap";

function Input (){
    const [text,setText] = useState("")

    const onch = (event)=> {
        const t = event.target.value
        setText(t)
        
    }

    return(
        <div>
            


            <div className="dropdown">
                <button className="btn btn-secondary dropdown-toggle" type="button" id="dropdownMenuButton" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                    Dropdown button
                </button>
                <div className="dropdown-menu" aria-labelledby="dropdownMenuButton">
                    <a className="dropdown-item" href="fcielistic.com">Action</a>
                    <a className="dropdown-item" href="fcielistic.com">Another action</a>
                    <a className="dropdown-item" href="fcielistic.com">Something else here</a>
                </div>
               
            </div>








            <br></br>
            <from>
                <input onChange={onch} type="text"></input>
            </from>

            <ul>
                <li>useState: {text}</li>
            </ul>
            <br></br>
            <hr></hr>
            
        </div>
        
        
    )

}


export default Input;
